webpackJsonp([41,428],{1531:function(e,s,n){e.exports={frontmatter:n(538),content:n(2714)}},2714:function(e,s,n){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I denne oppgaven skal vi skrive kode, slik at vi kan skrive stor tekst ved hjelp av <code>turtle</code> slik som på bildet under.</p> <figure><img src="+n(3458)+' alt=""></figure> </section> <section class=activity id=steg-1-tekst-pa-flere-linjer> <h1 class=activity id=steg-1-tekst-pa-flere-linjer>Steg 1: Tekst på flere linjer</h1> <p>Vi har allerede lært at tekststrenger skrives slik:</p> <pre><code class=python>tekst = <span class=hljs-string>"Hei, verden!"</span>\n</code></pre> <p>Men hva hvis vi ønsker tekst på flere linjer? Da kan vi bruke tre <code>&quot;</code>-tegn, på denne måten:</p> <pre><code><span class=hljs-attr>tekst</span> = <span class=hljs-string>"""\nDette er en\ntekst\nover\nmange linjer.\n"""</span>\n</code></pre> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Skriv inn programmet over, og kjør det. Kommer teksten på flere linjer?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Lagre det følgende programmet som <a href=http://skilpaddetekst.py>skilpaddetekst.py</a>, og se hva som skjer.</label></p> <pre><code class=python><span class=hljs-keyword>from</span> turtle <span class=hljs-keyword>import</span> *\n\n\nTEXT = <span class=hljs-string>"""\n______      _   _\n| ___ \\    | | | |\n| |_/ /   _| |_| |__   ___  _ __\n|  __/ | | | __| \'_ \\ / _ \\| \'_ \\\\\n| |  | |_| | |_| | | | (_) | | | |\n\\_|   \\__, |\\__|_| |_|\\___/|_| |_|\n       __/ |\n      |___/\n"""</span>\n\nprint(TEXT)\n</code></pre> <p>Du skal nå se teksten printet ut i IDLE, men kan vi ikke få skilpadden til å skrive den for oss?</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Når vi skal skrive teksten med skilpadden, er det lettest å gjøre dette linje for linje, og det er derfor lettere om vi deler opp <code>TEXT</code> i en liste med enkeltlinjer. Til dette bruker vi <code>TEXT.split(\'\\n\')</code> som deler opp <code>TEXT</code> i flere linjer, og lagre denne i variabelen <code>LINES</code>.</label></p> <pre><code class=python>LINES = TEXT.split(<span class=hljs-string>\'\\n\'</span>)\n\nprint(LINES)\n</code></pre> </li> </ul> </section> </section> <section class=activity id=steg-2-tegn-med-skilpadden> <h1 class=activity id=steg-2-tegn-med-skilpadden>Steg 2: Tegn med skilpadden</h1> <p>Vi ser at teksten over består av tegnene <code>\\ | / _</code>. Det å lage disse hver for seg burde være en smal sak.</p> <p>Hvis vi tenker oss at vi tegner hvert tegn i en tenkt, kvadratisk boks, med flere bokser ved siden av hverandre på hver linje, så bør det være mulig å tegne teksten tegn for tegn. For å holde kontroll på skilpadden bestemmer vi at hver gang skilpadden går inn i en ny boks, så må den peke mot høyre (øst), og være i hjørnet øverst til venstre. Når den er ferdig å tegne går den opp til hjørnet øverst til høyre, og peker til høyre. Den vil da stå klar til å tegne neste boks.</p> <p>Tenk deg at boksene er i svart, og vi lager rød skrift. Da vil det se slik ut: <img src='+n(3456)+' alt=""></p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Vi begynner med å legge til størrelsen på tegnene, slik:</label></p> <p>(Pass på at denne koden ligger i samme fil som <code>TEXT</code>-variabelen.)</p> <pre><code class=python>SIZE  = <span class=hljs-number>15</span>\n</code></pre> <p><code>SIZE</code> er nå en variabel som inneholder størrelsen på boksen vår.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Vi lager en funksjon <code>underline</code> for å lage en understrek:</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>underline</span><span class=hljs-params>()</span>:</span>\n    penup()\n\n    <span class=hljs-comment># Beveg skilpadden ned til bunnen av boksen</span>\n    right(<span class=hljs-number>90</span>)\n    forward(SIZE)\n    left(<span class=hljs-number>90</span>)\n\n    <span class=hljs-comment># tegn understreken</span>\n    pendown()\n    forward(SIZE)\n    penup()\n\n    <span class=hljs-comment># beveg skilpadden opp til hjørnet øverst til høyre</span>\n    left(<span class=hljs-number>90</span>)\n    forward(SIZE)\n    right(<span class=hljs-number>90</span>)\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Kjør koden, og se hva som skjer:</label></p> <pre><code class=python>underline()\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Hva om vi ønsker å lage 10 understreker?</label></p> <pre><code class=python><span class=hljs-keyword>for</span> n <span class=hljs-keyword>in</span> range(<span class=hljs-number>10</span>):\n    underline()\n</code></pre> <p>Det skal se slik ut, hvis du du ikke har feil i koden: <img src='+n(3460)+' alt=""></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Hva skjer hvis du endrer størrelsen på &quot;boksen&quot;? Prøv å endre på <code>SIZE</code> variabelen, og se hva som skjer. (Prøv for eksempel 5 og 50)</label></p> </li> </ul> </section> </section> <section class=activity id=steg-3-enda-et-tegn> <h1 class=activity id=steg-3-enda-et-tegn>Steg 3: Enda et tegn</h1> <p>La oss prøve å lage tegnet <code>|</code>. Dette er rett og slett bare en rett strek som skal tegnes lodrett, midt i &quot;boksen&quot;.</p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Vi lager funksjonen <code>bar</code> for å tegne <code>|</code>.</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>bar</span><span class=hljs-params>()</span>:</span>\n    penup()\n\n    <span class=hljs-comment># flytt til midten av boksen</span>\n    forward(SIZE/<span class=hljs-number>2</span>)\n    right(<span class=hljs-number>90</span>)\n\n    <span class=hljs-comment># tegn en strek nedover</span>\n    pendown()\n    forward(SIZE)\n    penup()\n\n    <span class=hljs-comment># flytt skilpadden til hjørnet øverst til høyre</span>\n    left(<span class=hljs-number>180</span>)\n    forward(SIZE)\n    right(<span class=hljs-number>90</span>)\n    forward(SIZE/<span class=hljs-number>2</span>)\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Endre <code>for</code>-løkka vi lagde tidligere til å inneholde dette</label></p> <pre><code class=python><span class=hljs-keyword>for</span> n <span class=hljs-keyword>in</span> range(<span class=hljs-number>10</span>):\n    bar()\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Tegner skilpadden nå strekene på samme linje, slik som på bildet?</label></p> <figure><img src='+n(3455)+' alt=""></figure> </li> </ul> </section> </section> <section class=activity id=steg-4-skilpaddetegn-pa-flere-linjer> <h1 class=activity id=steg-4-skilpaddetegn-pa-flere-linjer>Steg 4: Skilpaddetegn på flere linjer</h1> <p>Det er jo litt kjedelig om alle tegnene bare skal være på en linje, så hva med å lage en ny funksjon som lager en ny linje for oss?</p> <p>For å kunne lage en ny linje må funksjonen vite hvor mange tegn den skal gå tilbake, vi må derfor deklarere funksjonen, med et parameter - en variabel som vi kan gi til funksjonen når vi skal kjøre den.</p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Skriv inn koden under:</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>newline</span><span class=hljs-params>(lineLength)</span>:</span>\n    penup()\n\n    right(<span class=hljs-number>90</span>)\n    forward(SIZE)\n    right(<span class=hljs-number>90</span>)\n\n    forward(SIZE*lineLength)\n\n    right(<span class=hljs-number>180</span>)\n</code></pre> <p>Denne koden går først ned til linjen under, så går den tilbake begynnelsen av linjen. Legg merke til at vi kaller <code>forward</code> med <code>SIZE*lineLength</code> som argumenter. <code>lineLength</code> er hvor mange tegn som er på linjen vi kom fra, og <code>SIZE</code> er hvor stort hvert tegn er - dermed må skilpadden flytte seg <code>SIZE*lineLength</code> piksler tilbake.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> For å teste koden vår erstatter vi de tidligere <code>for</code>-løkkene med denne koden (pass på at dette blir plassert nederst i filen):</label></p> <pre><code class=python><span class=hljs-keyword>for</span> i <span class=hljs-keyword>in</span> range(<span class=hljs-number>10</span>):\n    underline()\nnewline(<span class=hljs-number>10</span>)\n<span class=hljs-keyword>for</span> i <span class=hljs-keyword>in</span> range(<span class=hljs-number>15</span>):\n    bar()\n</code></pre> <p>Legg merke til at <code>newline</code> blir fortalt hvor mange tegn som ble skrevet på linjen over, ikke hvor mange som skal bli skrevet på linjen under!</p> <p>Dette skal se omtrent slik ut: <img src='+n(3457)+" alt=\"\"></p> </li> </ul> </section> </section> <section class=activity id=steg-5-skilpadder-pa-skraplanet> <h1 class=activity id=steg-5-skilpadder-pa-skraplanet>Steg 5: Skilpadder på skråplanet</h1> <p>Nå har vi bare to tegn igjen å lage! Nemlig <code>/</code> og <code>\\</code>. Disse tegnene må tegnes på skrå. Vi kan dermed ikke lenger tegne streker av lengde <code>SIZE</code>, vi er nødt til å regne litt.</p> <p>Hvis du går på ungdomsskolen har du kanskje lært at sammenhengen mellom katetene og hypotenusen i et rettvinklet trekant er slik <code>a² + b² = c²</code>, det er dermed mulig å regne ut diagonalen til firkanten.</p> <p>Her skal du bare få svaret og slippe å regne det ut selv. Diagonalen i boksene våre vil være lik <code>(2 * SIZE**2)**0.5</code>. <code>**</code>-operatoren betyr &quot;opphøyd i&quot; slik at <code>3**2</code> blir <code>9</code>. Når du opphøyer noe i <code>0.5</code>, er det det samme som å ta kvadratrota av tallet. Dermed vil <code>9**0.5</code> bli <code>3.0</code> Dersom du lurer på hvordan dette fungerer kan du spørre en CodeMaster/veileder, eller mattelæreren din.</p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Koden for en 'slash' - <code>/</code> blir slik:</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>slash</span><span class=hljs-params>()</span>:</span>\n    penup()\n    right(<span class=hljs-number>90</span>)\n    forward(SIZE)\n    left(<span class=hljs-number>135</span>)\n\n    pendown()\n    forward((<span class=hljs-number>2</span>*SIZE**<span class=hljs-number>2</span>)**<span class=hljs-number>0.5</span>)\n    penup()\n\n    right(<span class=hljs-number>45</span>)\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Koden for en 'backslash' - <code>\\</code> blir slik:</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>backslash</span><span class=hljs-params>()</span>:</span> <span class=hljs-comment># \\</span>\n    penup()\n    right(<span class=hljs-number>45</span>)\n\n    pendown()\n    forward((<span class=hljs-number>2</span>*SIZE**<span class=hljs-number>2</span>)**<span class=hljs-number>0.5</span>)\n    penup()\n\n    left(<span class=hljs-number>135</span>)\n    forward(SIZE)\n    right(<span class=hljs-number>90</span>)\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> La oss endre på <code>for</code>-løkkene våre, og teste at koden blir korrekt (pass på at denne koden fremdeles ligger nederst).</label></p> <pre><code class=python>length = <span class=hljs-number>10</span>\n<span class=hljs-keyword>for</span> i <span class=hljs-keyword>in</span> range(length):\n    backslash()\nnewline(length)\n<span class=hljs-keyword>for</span> i <span class=hljs-keyword>in</span> range(length):\n    slash()\n</code></pre> <p>Denne gangen skal mønsteret bli slik: <img src="+n(3459)+' alt=""></p> <p>Nå er vi nesten ferdige! Bare litt igjen nå...</p> </li> </ul> </section> </section> <section class=activity id=steg-6-skilpaddetekst> <h1 class=activity id=steg-6-skilpaddetekst>Steg 6: Skilpaddetekst</h1> <p>Vi trenger en funksjon for å skrive blanke tegn, og vi trenger å oversette fra teksttegn til funksjoner. La oss begynne med det enkleste.</p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> For å skrive blanke tegn, så må vi, enkelt og greit, bare bevege oss til neste boks. Det gjør vi slik:</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>blank</span><span class=hljs-params>()</span>:</span>\n    forward(SIZE)\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> For å oversette fra teksttegn til funksjoner kommer vi til å bruke en dictionary. Dictionary betyr ordbok, og det er akkurat slik den fungerer. Vi &quot;slår opp&quot; noe i ordboka, og får noe tilbake. I vårt tilfelle skal vi slå opp på tegn, og få en funksjon tilbake igjen.</label></p> <p>Først lager vi ordboka:</p> <pre><code class=python>MOVES = {\n    <span class=hljs-string>" "</span> : blank,\n    <span class=hljs-string>"_"</span> : underline,\n    <span class=hljs-string>"/"</span> : slash,\n    <span class=hljs-string>"|"</span> : bar,\n    <span class=hljs-string>"\\\\"</span>: backslash,\n\n    <span class=hljs-string>"("</span> : bar,\n    <span class=hljs-string>")"</span> : bar,\n    <span class=hljs-string>"\'"</span> : blank,\n    <span class=hljs-string>","</span> : blank\n}\n</code></pre> <p>Nå kan vi slå opp på tegnet <code>-</code> og få funksjonen <code>underline</code> tilbake. Det kan vi for eksempel gjøre slik:</p> <pre><code class=python>function = MOVES[<span class=hljs-string>"_"</span>]\n</code></pre> <p>Når vi så kaller <code>function</code>, vil den gjøre det samme som <code>underline</code></p> <pre><code class=python>function = MOVES[<span class=hljs-string>"_"</span>]\nfunction()\n</code></pre> <p>Dersom vi ønsker å sjekke om et tegn er i ordboka, så kan vi sjekke det slik:</p> <pre><code class=python><span class=hljs-keyword>if</span> <span class=hljs-string>"_"</span> <span class=hljs-keyword>in</span> MOVES:\n    function = MOVES[<span class=hljs-string>"_"</span>]\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Nå kan vi lage en ny funksjon, <code>create_text</code> som lager teksten vår.</label></p> <p>For å passe på at vi får plass til all teksten vår, ønsker vi å begynne øverst til venstre i vinduet vårt. Dette kan vi fikse ved hjelp av <code>setx</code> og <code>sety</code> som lar oss flytte skilpadden til den posisjonen vi ønsker.</p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>create_text</span><span class=hljs-params>()</span>:</span>\n    penup()\n    setx(-window_width()/<span class=hljs-number>2</span>)\n    sety(window_height()/<span class=hljs-number>2</span>)\n\n    <span class=hljs-keyword>for</span> line <span class=hljs-keyword>in</span> LINES:\n        <span class=hljs-keyword>for</span> char <span class=hljs-keyword>in</span> line:\n            <span class=hljs-keyword>if</span> char <span class=hljs-keyword>in</span> MOVES:\n                move = MOVES[char]\n            <span class=hljs-keyword>else</span>:\n                move = blank\n            move()\n        newline(len(line))\n</code></pre> <p>Som du kanskje ser, så har vi en <code>for</code>-løkke inni en annen <code>for</code>-løkke. Den ytterste (første) <code>for</code>-løkka går igjennom alle linjene i <code>LINES</code>, mens den innerste går igjennom alle tegnene i hver linje. Inni den innerste <code>for</code>-løkka sjekker vi om vi har en funksjon for tegnet, og hvis vi ikke har det så hopper vi bare over det ved å skrive et blankt tegn i stedenfor.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> For å kjøre funksjonen vår, lager vi en <code>main</code>-funksjon som sørger for å sette riktig fart og riktig linjebredde.</label></p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>main</span><span class=hljs-params>()</span>:</span>\n    shape(<span class=hljs-string>"turtle"</span>)\n\n    speed(<span class=hljs-number>11</span>)\n    width(<span class=hljs-number>5</span>)\n    create_text()\n\nmain()\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Kjør koden og se resultatet ditt!</label></p> </li> </ul> </section> <section class=try id=kjore-koden-uendelig-mange-ganger> <h2 class=try id=kjore-koden-uendelig-mange-ganger>Kjøre koden uendelig mange ganger</h2> <p>Dersom du ønsker å kjøre koden uendelig mange ganger, kan du endre <code>main</code>-funksjonen til:</p> <pre><code class=python><span class=hljs-function><span class=hljs-keyword>def</span> <span class=hljs-title>main</span><span class=hljs-params>()</span>:</span>\n    shape(<span class=hljs-string>"turtle"</span>)\n\n    <span class=hljs-keyword>while</span> true:\n        speed(<span class=hljs-number>11</span>)\n        width(<span class=hljs-number>5</span>)\n        create_text()\n        sleep(<span class=hljs-number>5</span>)\n        reset()\n</code></pre> <p>For at dette skal fungere må vi importere <code>sleep</code>-funksjonen. Dette gjør vi helt på toppen:</p> <pre><code class=python><span class=hljs-keyword>from</span> turtle <span class=hljs-keyword>import</span> *\n<span class=hljs-keyword>from</span> time <span class=hljs-keyword>import</span> sleep\n</code></pre> <p>Skilpadden vil nå lage teksten, vente i fem sekunder (<code>sleep(5)</code>), og nullstille vinduet ved hjelp av <code>reset()</code> før den starter på nytt.</p> </section> <section class=challenge id=utfordringer> <h2 class=challenge id=utfordringer>Utfordringer</h2> <p>Dersom du går tilbake til ordboka vi deklarerte i MOVES-konstanten vil du se at vi &quot;jukset&quot; ved å tegne paranteser - <code>(</code> og <code>)</code> som <code>|</code>. Vi &quot;jukset&quot; også ved å bare tegne et blankt tegn istedenfor komma og apostrof - <code>,</code> og <code>\'</code>.</p> <p>Prøv å lage disse på egenhånd! <code>,</code> og <code>\'</code> er lettest, for disse kan tegnes som rette streker. For å kunne lage <code>(</code> og <code>)</code>, må du bruke det du har lært om sirkler!</p> <p>Lag kode for hvert tegn i en egen funksjon, og husk og oppdatere <code>MOVES</code>. For eksempel, hvis du lagde en komma-funksjon så må du endre</p> <p><code>&quot;,&quot;: blank</code></p> <p>til</p> <p><code>&quot;,&quot;: comma</code>,</p> <p>der <code>comma</code> er navnet på funksjonen din.</p> </section> </section> '},3455:function(e,s){e.exports="data:image/png;base64,"},3456:function(e,s,n){e.exports=n.p+"_/oppgaver/src/python/skilpaddetekst/turtle_box_gif.8f516c.gif"},3457:function(e,s){e.exports="data:image/png;base64,"},3458:function(e,s){e.exports="data:image/png;base64,"},3459:function(e,s){e.exports="data:image/png;base64,"},3460:function(e,s){e.exports="data:image/png;base64,"}});